function diffArray(arr1, arr2) {
  var newArr = [];
  // Same, same; but different.
  for (let i = 0; i <= arr1.length - 1; i++) {
    if (arr2.some((val) => arr1[i] == val) == false) {
      newArr.push(arr1[i]);
    }
  }
  for (let j = 0; j <= arr2.length - 1; j++) {
    if (arr1.some((val) => arr2[j] == val) == false) {
      newArr.push(arr2[j]);
    }
  }  
  return newArr;
}

